DBI::dbExecute(con,"CREATE TABLE temp_P AS SELECT P.*, R.RB245 AS SELRES, R.RB040 AS PHID, R.RB081 AS AGE FROM P LEFT JOIN R ON PB010=RB010 AND PB030=RB030 WHERE RB110 < 5 ")
