DBI::dbExecute(con,"CREATE TABLE temp_H AS 	SELECT DISTINCT H.*,	SUM(P.PGROINC) AS PGROINC, SUM(P.PNINCS) AS PNINCS, SUM(P.PNINCP) AS PNINCP	FROM H LEFT JOIN P	ON PHID = HB030 AND PB010 = HB010	GROUP BY HB030, HB010")
